Rules.InvariantScript:
If(
    drpTimeRange.Selected.Value = "Today",
    Set(SDate, Today());
    Set(EDate, Today()),
    If(
        drpTimeRange.Selected.Value = "Yesterday",
        Set(SDate, DateAdd(
            Today(),
            -1
        ));
        Set(EDate, DateAdd(
            Today(),
            -1
        )),
        If(
            drpTimeRange.Selected.Value = "This Week",
            Set(SDate, Today() - (Weekday(
                Today(),
                StartOfWeek.Sunday
            )) + 1);
            Set(EDate, DateAdd(
                Today(),
                (7 - Weekday(
                    Today(),
                    StartOfWeek.Sunday
                )),
                TimeUnit.Days
            )),
            If(
                drpTimeRange.Selected.Value = "Last Week",
                Set(SDate, Today() - (Weekday(
                    Today(),
                    StartOfWeek.Sunday
                )) - 6);
                Set(EDate, DateAdd(
                    Today(),
                    (7 - Weekday(
                        Today(),
                        StartOfWeek.Sunday
                    )) - 7,
                    TimeUnit.Days
                )),
                If(
                    drpTimeRange.Selected.Value = "This Month",
                    Set(SDate, Date(
                        Year(Today()),
                        Month(Today()),
                        1
                    ));
                    Set(EDate, Date(
                        Year(Today()),
                        Month(Today()) + 1,
                        1
                    ) - 1),
                    If(
                        drpTimeRange.Selected.Value = "Last Month",
                        Set(SDate, Date(
                            Year(Today()),
                            Month(Today()) - 1,
                            1
                        ));
                        Set(EDate, Date(
                            Year(Today()),
                            Month(Today()),
                            1
                        ) - 1),
                        If(
                            drpTimeRange.Selected.Value = "Month To Date",
                            Set(SDate, Date(
                                Year(Today()),
                                Month(Today()),
                                1
                            ));
                            Set(EDate, Today()),
                            If(
                                drpTimeRange.Selected.Value = "This Quarter",
                                Set(SDate, Date(
                                    Year(Today()),
                                    Month(Today()) - If(
                                        Mod(
                                            Month(Today()) - 1,
                                            3
                                        ) = 0,
                                        0,
                                        Mod(
                                            Month(Today()) - 1,
                                            3
                                        )
                                    ),
                                    1
                                ));
                                Set(EDate, Date(
                                    Year(Today()),
                                    Month(Today()) + 3 - Mod(
                                        Month(Today()) - 1,
                                        3
                                    ),
                                    1
                                ) - 1),
                                If(
                                    drpTimeRange.Selected.Value = "Last Quarter",
                                    Set(SDate, Date(
                                        Year(Today()),
                                        Month(Today()) - If(
                                            Mod(
                                                Month(Today()) - 1,
                                                3
                                            ) = 0,
                                            0,
                                            Mod(
                                                Month(Today()) - 1,
                                                3
                                            )
                                        ) - 3,
                                        1
                                    ));
                                    Set(EDate, Date(
                                        Year(Today()),
                                        Month(Today()) + 3 - Mod(
                                            Month(Today()) - 1,
                                            3
                                        ) - 3,
                                        1
                                    ) - 1),
                                    true
                                )
                            )
                        )
                    )
                )
            )
        )
    )
);
If(drpTimeRange.Selected.Value="Custom Time Frame",Set(CustomTime,true),Set(CustomTime,false))

